import React from 'react';

function HeroItem({ hero, onDelete, onEdit }) {
    return (
        <tr>
            <td>{hero.name}</td>
            <td>{hero.publisher}</td>
            <td>{hero.gender}</td>
            <td>{hero.height}</td>
            <td>{hero.weight}</td>
            <td>
                <button onClick={() => onEdit()} className="hero-button" style={{ backgroundColor: '#007bff', marginRight: '10px' }}>Editar</button>
                <button onClick={() => onDelete(hero.id)} className="hero-button" style={{ backgroundColor: '#dc3545' }}>Eliminar</button>
            </td>
        </tr>
    );
}

export default HeroItem;
